{
  "version": "0.2",
  "phases": {
    "pre_build": {
      "commands": [
        "cd springbootcdk",
        "cd ../springbooteclipse && npm install -g aws-cdk typescript"
      ]
    },
    "build": {
      "commands": [
        "mvn install && npm install",
        "npx run cdk synth"
      ]
    }
  },
  "artifacts": {
    "base-directory": "springbootcdk/cdk.out",
    "files": "**/*"
  }
}
